import "./VideoCall.css"
import React, { useState } from 'react'

const VideoCall = ({setcallbtn}) => {
    const [uid,setuid] = useState('')
    return (
        <div className="Call_container" onClick={() => setcallbtn(false)}>
            <div className="Call_container2">
                <div className="video_title">YOUR-TUBE COMMUNITY</div>
                <div className="form_field">
                    <input type="text" required placeholder="Enter UserId" value={uid} onChange={(e)=>setuid(e.target.value)} />
                </div>
            </div>
        </div>
    )
}

export default VideoCall
